import { Button, Nav, NavRow, Row, Col, Card, Form } from 'react-bootstrap';
import { connect } from 'react-redux';
import { Link, useHistory, useLocation, NavLink } from 'react-router-dom';
import { useState } from 'react';
import { fetch_user } from '../api';
import store from '../store';

function WellnessView({session, wellness, wellness_form}) {
  let location = useLocation()
  console.log(location)
  let wellness_id = location.split("/wellness/healths/")
  console.log(wellness_id)
}

function state2props({session, wellness, wellness_form}) {
  return {session, wellness, wellness_form};
}

export default connect(state2props)(WellnessView);
